  className,
  ...props
}) => {

  const classes = classNames(
    'brand',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >
      <h1 className="m-0">
        <Link to="/">
          <Image
            src='https://lh3.googleusercontent.com/ejbq9PuMI9S9lOcZxmhjfNoaqRemLCKWYhNTC6x_Vy3sb3SFdq3vpY-ZsEBgbggHj7211JjG_MJ_iguGcqFne9mKpwKWGwCxU6J31NOPSF66vrsp_8oe83N9s5SsN3xNxLT5SOkC6C-BA1L-Tp2TGFFrct9DnIwqaIjGvAXZs1XpR1jlj_di4n3NVXDyrVriqQZxWmybQg-ZFd_RcTYoWZVf1K4rnca4xnsCccFVuf_UD1z2kMCIIvjafiRjxUB9MG9lKtgHygkvkfZfQdEzWXEHdzWBpVbiqeMWPR_qhBD6l1tuFouID4SlO-_BI8HoCqYMNpxl1eo6dBUHYn1XaLqmby0JjkaVV2T-PQOLK3dHJW9Lr31mlXIrZgn08jYR_pXwD4J_CM4xTlQOljYoMrgKCUAYeT0O5zjhvfbtfy7YnpEXyW1vIT74eVI3iDB-IuiX6KQH6w9YRSq-TFuMw2b8Fcb-0UxKZonzUAE61h8XMhxtGpLeSlNzcxlc4B5VygMl3Rk_aMC6WyPo1ETAHMnUvrCihhMJXSjlYwAQI71Dm9pOqFKzywkHGhg_q4qIiDOZoA9BeT8LdfprVxB03avhPjneDXyAccCXFtXkITljWrr7b2jdbtm-fvwl7Nvz9RWEmUr9msjrS3QTGLuZMwHZoiqr24j9Lox44_oE7z-TzPA70VvyfW7zNWrLSGPACLpc0cjv34cqVIkzZXugvZo9=w225-h187-no?authuser=0'
            alt="E.G. Services Logo"
            width={32}
            height={32} />
        </Link>
      </h1>
    </div>
  );
}

